// src/Components/LocationPage.js

import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { getPokemon } from "./LearnService";
import MainList from "./MainList";

const LocationPage = () => {
  const { location } = useParams();
  const [pokemons, setPokemons] = useState([]);

  useEffect(() => {
    getPokemon().then((fetchedPokemon) => {
      const filteredPokemon = fetchedPokemon.filter(
        (pokemon) => pokemon.location === location
      );
      setPokemons(filteredPokemon);
    });
  }, [location]);

  return (
    <div>
      <h3>Pok√©mon Found in {location}</h3>
      <MainList pokemons={pokemons} />
    </div>
  );
};

export default LocationPage;
